import React from "react";
import "../../App.css";
import "../Profile.css";
import Card from "../Card";

export default function Profile({ loggedInEmail }) {
  const [bio, setBio] = useState(""); // State to store the bio value

  useEffect(() => {
    // Fetch the bio value when the component mounts
    const fetchData = async () => {
      try {
        const response = await fetch(`/advisee/bio/${loggedInEmail}`); // Replace 'userEmail' with the actual user's email
        const data = await response.json();
        setBio(data.bioAdvisees);
      } catch (error) {
        console.error("Error fetching bio:", error);
      }
    };

    fetchData();
  }, []);

  const cardData = {
    type: "Student",
    profilePicture: "../../../images/profile-icon.jpg",
    name: "John Doe",
    researchInterests: "Machine Learning",
    educationLevel: "Ph.D.",
    school: "McGill Univeristy",
    fieldOfStudy: "Computer Science",
    bio: "I like dogs and hockey",
  };
  return (
    <div className="profile">
      <h1 className="profile">PROFILE</h1>
      <Card {...cardData} />
    </div>
  );
}
